import { PostPreview } from '../components/postPreview'
import { posts } from '../utils/getAllPosts'

export default function IndexPage() {
  return (
    <>
      <h1>Blog</h1>
      <p>My regular cadence is two articles per month. Wish me luck!</p>
      {posts.map(post => (
        <PostPreview key={post.link} post={post} className="mb-6" />
      ))}
    </>
  )
}
